import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './DashboardWithCategory.css';

const DashboardWithCategory = () => {
    const [searchTerm, setSearchTerm] = useState('');
    const [categories, setCategories] = useState([
        // Sample data
        { id: 1, name: 'Category 1', image: 'image1.jpg', status: 'Active', sequence: 1 },
        { id: 2, name: 'Category 2', image: 'image2.jpg', status: 'Inactive', sequence: 2 },
    ]);
    const navigate = useNavigate();

    const handleSearch = (event) => {
        setSearchTerm(event.target.value);
    };

    const handleAdd = () => {
        navigate('/add-category');
    };

    const handleEdit = (id) => {
        // Handle edit logic
    };

    const handleDelete = (id) => {
        // Handle delete logic
    };

    const handleLogout = () => {
        // Perform any logout logic here, such as clearing user data
        alert('Logged out');
        navigate('/login');
    };

    const filteredCategories = categories.filter(category =>
        category.name.toLowerCase().includes(searchTerm.toLowerCase())
    );

    return (
        <div className="dashboard">
            <div className="sidebar">
                <ul>
                    <li>Dashboard Home</li>
                    <li>Category</li>
                    <li>Subcategory</li>
                    <li>Products</li>
                </ul>
            </div>
            <div className="main-content">
                <div className="top-bar">
                    <button className="logout-button" onClick={handleLogout}>Log Out</button>
                </div>
                <div className="content">
                    <div className="category-container">
                        <div className="search-add-container">
                            <input
                                type="text"
                                placeholder="Search..."
                                value={searchTerm}
                                onChange={handleSearch}
                            />
                            <button onClick={handleAdd}>Add</button>
                        </div>
                        <table className="category-table">
                            <thead>
                                <tr>
                                    <th>ID</th>
                                    <th>Category Name</th>
                                    <th>Image</th>
                                    <th>Status</th>
                                    <th>Sequence</th>
                                    <th>Action</th>
                                </tr>
                            </thead>
                            <tbody>
                                {filteredCategories.map(category => (
                                    <tr key={category.id}>
                                        <td>{category.id}</td>
                                        <td>{category.name}</td>
                                        <td><img src={category.image} alt={category.name} width="50" /></td>
                                        <td>{category.status}</td>
                                        <td>{category.sequence}</td>
                                        <td>
                                            <button onClick={() => handleEdit(category.id)}>Edit</button>
                                            <button onClick={() => handleDelete(category.id)}>Delete</button>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default DashboardWithCategory;
